"use strict";(self.webpackChunkspanish_prototype=self.webpackChunkspanish_prototype||[]).push([[130],{130:e=>{e.exports=JSON.parse('{"lessonId":"A2_U52","title":"\u0423\u0440\u043e\u043a 52: \u041d\u0430\u0441\u0442\u043e\u044f\u0449\u0435\u0435 \u0432\u0440\u0435\u043c\u044f \u0434\u043b\u044f \u0432\u044b\u0440\u0430\u0436\u0435\u043d\u0438\u044f \u043f\u0435\u0440\u0438\u043e\u0434\u043e\u0432 \u0432\u0440\u0435\u043c\u0435\u043d\u0438","level":"A2","components":[{"type":"TheoryBlock","title":"\u0422\u0435\u043e\u0440\u0438\u044f: \u041a\u043e\u043d\u0441\u0442\u0440\u0443\u043a\u0446\u0438\u0438 \u0434\u043b\u044f \u0432\u044b\u0440\u0430\u0436\u0435\u043d\u0438\u044f \u0434\u043b\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u0438 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f","content":[{"text":"<strong>Presente de indicativo \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0441\u044f \u0434\u043b\u044f \u043e\u0431\u043e\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u044f \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0439 \u0438\u043b\u0438 \u0441\u0438\u0442\u0443\u0430\u0446\u0438\u0439, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u043d\u0430\u0447\u0430\u043b\u0438\u0441\u044c \u0432 \u043f\u0440\u043e\u0448\u043b\u043e\u043c \u0438 \u043f\u0440\u043e\u0434\u043e\u043b\u0436\u0430\u044e\u0442\u0441\u044f \u0432 \u043d\u0430\u0441\u0442\u043e\u044f\u0449\u0435\u043c.</strong>"},{"text":"<strong>1. presente de indicativo + desde + \u0434\u0430\u0442\u0430</strong><br><i>Conozco a Elsa <strong>desde</strong> 2002.<br>Trabajo en un banco <strong>desde</strong> el a\xf1o pasado.<br>No voy al teatro <strong>desde</strong> Navidad.</i>"},{"text":"<strong>2. presente de indicativo + desde hace + \u043f\u0435\u0440\u0438\u043e\u0434 \u0432\u0440\u0435\u043c\u0435\u043d\u0438</strong><br><i>Keiko estudia espa\xf1ol <strong>desde hace</strong> tres meses.<br>Rosana y Alberto viven en Argentina <strong>desde hace</strong> dos a\xf1os.<br>No veo a Pili <strong>desde hace</strong> mucho tiempo.</i>"},{"text":"<strong>3. hace + \u043f\u0435\u0440\u0438\u043e\u0434 \u0432\u0440\u0435\u043c\u0435\u043d\u0438 + que + presente de indicativo</strong><br><i><strong>Hace</strong> dos d\xedas que no miro el correo electr\xf3nico. (Clara sigue sin mirar)<br><strong>Hace</strong> un a\xf1o que estudio espa\xf1ol.</i>"}]},{"type":"FillInTheBlank","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 52.1: \u0414\u043e\u043f\u043e\u043b\u043d\u0438\u0442\u0435 \u0434\u0438\u0430\u043b\u043e\u0433\u0438 \u043f\u0440\u0430\u0432\u0438\u043b\u044c\u043d\u043e\u0439 \u0444\u043e\u0440\u043c\u043e\u0439 \u0433\u043b\u0430\u0433\u043e\u043b\u0430","tasks":[{"id":"u52_1_1","sentence":"1. \xbfCu\xe1nto tiempo hace que (vivir) ___ usted en Caracas?","answer":"vive"},{"id":"u52_1_2","sentence":"2. \u2013\xbfHablas espa\xf1ol? \u2013S\xed, lo (hablar) ___ desde que era peque\xf1o.","answer":"hablo"},{"id":"u52_1_3","sentence":"3. \u2013\xbfHace mucho que (conocer) ___ a Ronaldo? \u2013S\xed, lo ___ desde 1995.","answer":"conoces, conozco"},{"id":"u52_1_4","sentence":"4. \u2013\xbfCu\xe1nto tiempo hace que (vivir) ___ ustedes en Quito? \u2013Diez meses.","answer":"viven"},{"id":"u52_1_5","sentence":"5. \u2013\xbfDesde cu\xe1ndo (ser) ___ amigos Jorge y t\xfa? \u2013___ amigos desde hace unos cinco a\xf1os.","answer":"sois, Somos"},{"id":"u52_1_6","sentence":"6. \u2013Hace dos semanas que (trabajar) ___ en este bar. Me gusta.","answer":"trabajo"},{"id":"u52_1_7","sentence":"7. \u2013\xbfDesde cu\xe1ndo no (ver) ___ a Petra? \u2013No la ___ desde el verano pasado.","answer":"ves, veo"},{"id":"u52_1_8","sentence":"8. Lucas y Alba no (tener) ___ vacaciones desde hace cuatro a\xf1os.","answer":"tienen"},{"id":"u52_1_9","sentence":"9. \xbfHace mucho que (conducir) ___ usted?","answer":"conduce"},{"id":"u52_1_10","sentence":"10. \xbfCu\xe1nto tiempo hace que (conocerse) ___ Elisa y Mario?","answer":"se conocen"}]},{"type":"FillInTheBlank","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 52.2: \u0412\u044b\u0440\u0430\u0437\u0438\u0442\u0435 \u0438\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0438\u044e, \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u044f \u0443\u043a\u0430\u0437\u0430\u043d\u043d\u044b\u0435 \u0441\u043b\u043e\u0432\u0430","tasks":[{"id":"u52_2_1","sentence":"1. Lupe conoce a Jaime. Lo conoci\xf3 en 2001. \u2192 Lupe <u>conoce a Jaime desde 2001</u>.","answer":"conoce a Jaime desde 2001"},{"id":"u52_2_2","sentence":"2. Yasir estudia espa\xf1ol. Empez\xf3 a estudiarlo hace seis meses. (Yasir) \u2192 ___","answer":"Yasir estudia espa\xf1ol desde hace seis meses"},{"id":"u52_2_3","sentence":"3. La \xfaltima vez que vimos el mar fue hace un a\xf1o. (Hace) \u2192 ___","answer":"Hace un a\xf1o que no vemos el mar"},{"id":"u52_2_4","sentence":"4. Patricia dej\xf3 de venir el d\xeda de su cumplea\xf1os. (Patricia) \u2192 ___","answer":"Patricia no viene desde el d\xeda de su cumplea\xf1os"},{"id":"u52_2_5","sentence":"5. La \xfaltima vez que mis padres me escribieron fue en Navidad. (Mis padres) \u2192 ___","answer":"Mis padres no me escriben desde Navidad"},{"id":"u52_2_6","sentence":"6. Salgo con Rosario. Empec\xe9 a salir con ella hace un mes. (Hace) \u2192 ___","answer":"Hace un mes que salgo con Rosario"},{"id":"u52_2_7","sentence":"7. La \xfaltima vez que fui al cine fue hace dos semanas. (Hace) \u2192 ___","answer":"Hace dos semanas que no voy al cine"},{"id":"u52_2_8","sentence":"8. Vivo en Guayaquil. Llegu\xe9 all\xed en 1999. (Yo) \u2192 ___","answer":"Yo vivo en Guayaquil desde 1999"},{"id":"u52_2_9","sentence":"9. Estoy buscando mis gafas. Empec\xe9 a buscarlas hace una hora. (Hace) \u2192 ___","answer":"Hace una hora que busco mis gafas"},{"id":"u52_2_10","sentence":"10. La \xfaltima vez que mis padres comieron carne fue hace cinco a\xf1os. (Hace) \u2192 ___","answer":"Hace cinco a\xf1os que mis padres no comen carne"},{"id":"u52_2_11","sentence":"11. Tengo m\xf3vil. Lo compr\xe9 en julio. (Yo) \u2192 ___","answer":"Yo tengo m\xf3vil desde julio"},{"id":"u52_2_12","sentence":"12. La \xfaltima vez que Jos\xe9 vio a Marisa fue en verano. (Jos\xe9) \u2192 ___","answer":"Jos\xe9 no ve a Marisa desde verano"}]},{"type":"FillInTheBlank","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 52.3: \u0421\u0444\u043e\u0440\u043c\u0443\u043b\u0438\u0440\u0443\u0439\u0442\u0435 \u0432\u043e\u043f\u0440\u043e\u0441\u044b \u043a \u043e\u0442\u0432\u0435\u0442\u0430\u043c","tasks":[{"id":"u52_3_1","sentence":"1. ___? \u2013Hace cinco a\xf1os que conozco a C\xe9sar.","answer":"\xbfCu\xe1nto tiempo hace que conoces a C\xe9sar?"},{"id":"u52_3_2","sentence":"2. ___? \u2013No fumo desde hace un mes.","answer":"\xbfDesde cu\xe1ndo no fumas?"},{"id":"u52_3_3","sentence":"3. ___? \u2013Hace dos a\xf1os que vivimos en M\xe9rida.","answer":"\xbfCu\xe1nto tiempo hace que viv\xeds en M\xe9rida?"},{"id":"u52_3_4","sentence":"4. ___? \u2013As\xfan y yo salimos juntos desde que ten\xedamos diecis\xe9is a\xf1os.","answer":"\xbfDesde cu\xe1ndo sal\xeds juntos As\xfan y t\xfa?"},{"id":"u52_3_5","sentence":"5. ___? \u2013Mi padre trabaja en esta empresa desde que ten\xeda veinte a\xf1os.","answer":"\xbfDesde cu\xe1ndo trabaja tu padre en esta empresa?"},{"id":"u52_3_6","sentence":"6. ___? \u2013Hace dos a\xf1os que estudiamos espa\xf1ol.","answer":"\xbfCu\xe1nto tiempo hace que estudi\xe1is espa\xf1ol?"},{"id":"u52_3_7","sentence":"7. ___? \u2013No vamos al cine desde las pasadas Navidades.","answer":"\xbfDesde cu\xe1ndo no vais al cine?"},{"id":"u52_3_8","sentence":"8. ___? \u2013Hace much\xedsimo tiempo que no como un helado.","answer":"\xbfCu\xe1nto tiempo hace que no comes un helado?"}]}]}')}}]);